import base64
from PIL import Image

# Paste your base64 string into the variable below.
b64_data = """"""
# (Make sure the triple-quoted string above contains the full base64 text you provided.)

# Decode the base64 string to get the raw RGB bytes.
raw_bytes = base64.b64decode(b64_data)

# Verify the length.
expected_bytes = 64 * 64 * 3
print("Decoded bytes:", len(raw_bytes), "Expected bytes:", expected_bytes)

# Create an image from the raw RGB data.
img = Image.frombytes('RGB', (64, 64), raw_bytes)

# Save or display the image.
img.show()        # Opens the image using your default image viewer
img.save("output_image.png")  # Optionally, save the image to a file.
